import React from 'react';

type Props = React.PropsWithChildren<{
    photo: string;
    photoAlt: string;
    text1: string;
    text2: string;
    text3: string;
    text4: string;
    button1Text: string;
    button2Text: string;
}>;

function Card(props: Props) {
    return (
        <div className="card">
            <div className="card-body">
                <div className="row">
                    <div className="col-3">
                        <img src={props.photo} alt={props.photoAlt} />
                    </div>
                    <div className="col-9">
                        <div className="card-text">{props.text1}</div>
                        <div className="card-text">{props.text2}</div>
                        <div className="card-text">{props.text3}</div>
                        <div className="card-text">{props.text4}</div>
                        <button className="btn btn-primary">{props.button1Text}</button>
                        <button className="btn btn-secondary">{props.button2Text}</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Card;
